import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="item">
        <img className="img-sub"></img>
        <span>Walls</span>
      </div>
      <div className="item">
        <img className="img-sub"></img>
        <span>Visited nodes</span>
      </div>
      <div className="item">
        <img className="img-sub"></img>
        <span>Resulting path</span>
      </div>
      <div className="item">
        <img className="img-sub"></img>
        <span>Origin</span>
      </div>
      <div className="item">
        <img className="img-sub"></img>
        <span>Destination</span>
      </div>
    </div>
  );
};

export default Footer;
